import React from 'react';
import './NewLift.scss';

const NewLift = props => {
  const liftList = ["SQUAT", "BENCH PRESS", "DEADLIFT"];
  return (
    <div id="new-lift">
      <form id="lift-list">
        {liftsList.map(lift => {
          <label>
              {lift}
            <input type="radio" value={lift} />
          </label>
        })}
        <input type="submit" value="ADD LIFT"/>
      </form>
      <button type="button" onClick={props.toggleModal} className="button-one">
        CANCEL
      </button>
    </div>
  );
};

export default NewLift;
